import React, { useEffect, useState } from 'react'

const App = () => {
  const [num, setnum] = useState(0)

  useEffect(()=>{
    // alert("clicked")
    document.title = `you clicked ${num} ti`
  })
  return (
    <>
      <button
      onClick={()=>{
        setnum(num+1)
      }}
      >
        clicke me {num}
      </button>
    </>
  )
}

export default App
